	left join aspirantes a on u.id=a.idUsuario
	left join catestatus ce on ce.id=a.idEstatus
	where u.curp like concat("%",(select _nombre COLLATE utf8_spanish_ci),"%") 
	or concat(u.nombre," ",u.primerApellido," ",u.segundoApellido) like concat("%",(select _nombre COLLATE utf8_spanish_ci),"%")
    and u.entidad = _idEntidad and u.plantel = _idPlantel and a.idEstatus = _idEstatus;
END ;;
