CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_consultarComites`(in _idEntidad int,in _idPlantel int,in _idPrograma int, in _tipo int)
BEGIN
	select c.id,c.idEntidad,e.entidad,c.idPlantel,p.plantel,c.idPrograma,c.tipo,mc.nombre,cp.programa
    from comite c
    join catplanteles p on c.idPlantel=p.id
	join catentidades e on c.idEntidad=e.id
    join catprogramas cp on c.idPrograma=cp.id
    left join miembrocomite mc on c.id=mc.idComite
    where c.idEntidad=_idEntidad and c.idPlantel = _idPlantel and c.idPrograma = _idPrograma and c.tipo = _tipo;
END ;;
