CREATE DEFINER=`admin`@`localhost` PROCEDURE `sp_consultaRegistro`(in _idUsuario int)
BEGIN
	SELECT 
		u.id,
		u.nombre,
        u.primerApellido,
        u.segundoApellido,
        u.correo,
        u.curp,		
		u.plantel as idPlantel,
        u.entidad as idEntidad,
        q.entidad,
        b.cct,
        b.plantel,
		u.telfijo,
		u.telcel,
		u.consideraciones,
		a.idEscuelaEstudio,
        c.escuela,
		a.idCarrera,
        d.carrera,
		a.anioEgreso,
		a.idGradoAcademico,
        e.grado,
		a.idModalidadTitulacion,
        f.modalidad,
		a.anioTitulacion,
		a.cedula,
		a.activo,
		a.ingresoSubsistema,
		a.ingresoPlantel,
		a.idCategoriaJornada,
        g.clave,
        g.idCategoria,
        h.categoria,
        g.idJornada,
        i.jornada,
		a.fechaPlaza,
		a.idTipoNombramiento,
        j.codigo,
        j.descripcion,
        j.tipo,
		a.fechaUltimaPromocion,
		a.idCategoriaJornadaAspira,
        k.clave as claveAspira,
        k.idCategoria as idCategoriaAspira,
        l.categoria as categoriaAspira,        
        k.idJornada as idJornadaAspira,
        m.jornada as jornadaAspira,
		a.idPerfilRequerido,
        n.requisito,
		a.notaSancion,
		a.compatibilidad,
		a.horasOtroSubsistema,
		a.nivelCENNI,
		a.folioCENNI,
		a.idCCT,
        o.cct as cctEstudio,
        r.idEntidad as idEntidadEstudio,
        c.idInstitucion,
        r.idTipoInstitucion,
        b.gradoMarginacion,
        a.frenteGrupo,
        a.funcionesOtro,
		a.finRegistro,
        u.consideraciones,
        a.publico,
        p.idPrograma,
        u.idConvocatoria
	FROM usuario u
    left join aspirantes a on u.id=a.idUsuario
    left join catplanteles b on u.plantel=b.id
    left join catentidades q on u.entidad=q.id
    left join catescuelas c on a.idEscuelaEstudio=c.id
    left join catinstituciones r on c.idInstitucion=r.id
    left join catcarreras d on a.idCarrera=d.id
    left join catgradosacademicos e on a.idGradoAcademico=e.id
    left join catmodalidadestitulacion f on a.idModalidadTitulacion=f.id
    left join catcategoriajornada g on a.idCategoriaJornada=g.id
    left join catcategoriasplaza h on g.idCategoria=h.id
    left join catjornada i on g.idJornada=i.id
    left join cattiposnombramiento j on a.idTipoNombramiento=j.id
    left join catcategoriajornada k on a.idCategoriaJornadaAspira=k.id
    left join catcategoriasplaza l on k.idCategoria=l.id
    left join catjornada m on k.idJornada=m.id
    left join catrequisitosplaza n on a.idPerfilRequerido=n.id
    left join catinstitucioncct o on a.idCCT=o.id    
    left join convocatoria p on u.idConvocatoria=p.id
	where u.id=_idUsuario;

END ;;
DELIMITER ;
