CREATE DEFINER=`admin`@`localhost` PROCEDURE `sp_insertAportaciones`(in _idUsuario int,in _idAportacion int,in _fechaInicio date,in _fechaFin date,in _institucion varchar(200),in _aportacion varchar(500),in _documento varchar(100))
BEGIN
	declare _idAux int default null;
	if _idAportacion <1  then
		if _aportacion is not null then
			select id into _idAux
            from cataportacion
            where aportacion like concat("%",_aportacion,"%");
            if _idAux is null then
				insert into cataportacion (aportacion) value (_aportacion);
                select id into _idAux from cataportacion where aportacion=_aportacion;
            end if;
		else
			select "Indíque el nombre de la aportación" as retorno;
        end if;
	else 
		set _idAux=_idAportacion;
    end if;
    if _idAux is not null then
		insert into aportaciones (idUsuario,idAportacion,fechaInicio,fechaFin,institucion,documento)
		values(_idUsuario,_idAux,_fechaInicio,_fechaFin,_institucion,_documento);
        select "ok" as retorno;
	end if;
END ;;
