CREATE DEFINER=`admin`@`localhost` PROCEDURE `sp_insertUsuario`(in _programa int,in _curp varchar(18),in _nombre varchar(50),in _primerApellido varchar(50),in _segundoApellido varchar(50),in _entidad int,in _plantel int,in _telfijo varchar(10),in _telcel varchar(10),in _correo varchar(50),in _consideraciones varchar(200),in _pass varchar(200),in _perfil varchar(1))
BEGIN
	declare _idAux int default null;
    declare _idConvocatoria int default null;
    select id into _idAux 
    from usuario
    where curp= (select _curp COLLATE utf8_spanish_ci);
    
    select id into _idConvocatoria
    from convocatoria 
    where idPrograma=_programa and idPlantel=_plantel;
    
    if(_idAux is null) then
		if(_idConvocatoria is not null) then
			insert into usuario (idConvocatoria,curp,nombre,primerApellido,segundoApellido,entidad,plantel,telfijo,telcel,correo,consideraciones,clave,perfil)
			values(_idConvocatoria,_curp,_nombre,_primerApellido,_segundoApellido,_entidad,_plantel,_telfijo,_telcel,_correo,_consideraciones,to_base64(_pass),_perfil);
			select "ok" as resultado; 
		else
			select 'No hay convocatoria registrada a ese plantel' as resultado;
        end if;
    else
		select 'Usuario previamente registrado' as resultado;
    end if;       
END ;;
