CREATE DEFINER=`admin`@`localhost` PROCEDURE `sp_registroConstancia`(in _idUsuario int, in _idRequisito int)
BEGIN
	declare _idAux int default null;
    
    select id into _idAux
    from constanciasregistro
    where idUsuario=_idUsuario
	and idRequisito=_idRequisito;
    
    if _idAux is null then
		insert into constanciasregistro (idUsuario,idRequisito,aceptado)
        values (_idUsuario,_idRequisito,"F");
    else
		update constanciasregistro 
        set aceptado="F"
        where idUsuario=_idUsuario
        and idRequisito=_idRequisito; 
    end if;
    
    select id from constanciasregistro
    where idUsuario=_idUsuario
	and idRequisito=_idRequisito;
END ;;
