CREATE DEFINER=`admin`@`localhost` PROCEDURE `sp_registroHorasGrupo`(in _idUsuario int, in _idPeriodo int, in _idAsignatura int,in _horas int,in _grupo varchar(5),in _semestre int)
BEGIN
	declare _idAux int default null;
    
    select id into _idAux
    from horasgrupo
    where idPeriodo=_idPeriodo
    and idAsignatura=_idAsignatura
    and grupo=_grupo
    and idUsuario=_idUsuario
    and semestre=_semestre;
    
    if _idAux is null then
		insert into horasgrupo (idPeriodo,idAsignatura,horas,grupo,idUsuario,ws,semestre,confirmada)
        values (_idPeriodo,_idAsignatura,_horas,_grupo,_idUsuario,'F',_semestre,'V');
	else
		update horasgrupo
    set horas=_horas,
			ws='F',
            confirmada='V'
    where idPeriodo=_idPeriodo
		and idAsignatura=_idAsignatura
		and grupo=_grupo
		and idUsuario=_idUsuario
        and semestre=_semestre;
    end if;
    select 'ok';
END ;;
DELIMITER ;
