CREATE DEFINER=`admin`@`localhost` PROCEDURE `sp_registroHorasGrupoWS`(in _idUsuario int, in _idPeriodo int, in _claveAsignatura varchar(20),in _horas int,in _grupo varchar(5),in _semestre int)
BEGIN
	declare _idAux int default null;
	declare _idAsignatura int default null;
    
    select id into _idAsignatura
    from catasignatura
    where clave=_claveAsignatura;
    
    select id into _idAux
    from horasgrupo
    where idPeriodo=_idPeriodo
    and idAsignatura=_idAsignatura
    and grupo=_grupo
    and idUsuario=_idUsuario
    and semestre=_semestre;
    
    if _idAsignatura is not null then
		if _idAux is null then
			insert into horasgrupo (idPeriodo,idAsignatura,horas,grupo,idUsuario,ws,semestre)
			values (_idPeriodo,_idAsignatura,_horas,_grupo,_idUsuario,'V',_semestre);	
		else
			update horasgrupo
			set horas=_horas,
					ws='V'
			where idPeriodo=_idPeriodo
				and idAsignatura=_idAsignatura
				and grupo=_grupo
				and idUsuario=_idUsuario
                and semestre=_semestre;    
        end if;
    end if;
    select 'ok';
END ;;
DELIMITER ;
