CREATE DEFINER=`admin`@`localhost` PROCEDURE `sp_selectHorasGrupo`(in _idUsuario int)
BEGIN
	select a.id,a.idPeriodo,b.periodo,a.idAsignatura,c.nombre,c.clave,a.semestre,c.tipo,c.optativa,a.horas,a.grupo,a.ws,a.confirmada
    from horasgrupo a
    inner join catperiodos b on a.idPeriodo=b.id
    inner join catasignatura c on a.idAsignatura=c.id
    where a.idUsuario=_idUsuario
    and (a.confirmada is null or a.confirmada='V')
    order by a.idPeriodo desc,a.grupo asc;
END ;;
